import React,{useState} from 'react'
import PrimarySearchAppBar from "./components/navbar/Navigation";
import axios from "axios";


function App() {
    const [auth, setAuth] = useState({});

    const onClickHandler = () => {
        axios.get("http://localhost:8080/user/me", {
            headers: {
                "Authorization": "Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxIiwiaWF0IjoxNTk4MDI5NjYzLCJleHAiOjE1OTg4OTM2NjN9.XKpFl8tAcoLWM3C71MpX0qxjAKapnB9LYMMW4Io24fBQityRSBC3r8d-D0wu40hwnoYz6BBalIC1dPVyGv8XPQ"
            },
        }).then(response => {
            setAuth(response)
        }).catch(err => {
            console.log(err)
        })
    };

    return (
        <div>
            <PrimarySearchAppBar/>
            <a href="http://localhost:8080/login/oauth2/code/google">구글로그인</a>

            <button onClick={onClickHandler}>click</button>
        </div>

    )
}

export default App
